import React from 'react'
import './welcom.css'
import { NavLink } from 'react-router-dom';

const welcome =  ()  => {
    return (
        <>
           <div className='container_note' id="welcome">
                    <div className='register-note text-center'>
                        <h4 className='note'>Welcome ,Get <b>Register</b> for ICDECT 2024 international conference</h4>
                        <NavLink to="/Registration" className='register_bnt'>Register</NavLink>
                    </div>
           </div>
        </>
    )
        
}

export default welcome
